Sure! Here is a simple Java program that adds two numbers and prints the result:

```java
public class AddTwoNumbers {
    public static void main(String[] args) {
        int num1 = 10;
        int num2 = 20;

        int sum = num1 + num2;

        System.out.println("The sum of " + num1 + " and " + num2 + " is: " + sum);
    }
}
```

In this program, we declare two integer variables `num1` and `num2` and assign them the values 10 and 20, respectively. We then add these two numbers together and store the result in the `sum` variable. Finally, we use `System.out.println()` to print the sum of the two numbers to the console.

You can run this program in any Java IDE or online Java compiler to see the output.
